import React, { useState } from 'react';
import ReactDOM from 'react-dom';
import * as heading from './header';
import * as cardbox from './cardbox';
import * as sideBar from './sidebar';
import * as table from './table';
import game from './game';
import App from './App';
import './css/style.css';
import { BrowserRouter , Switch , Route } from 'react-router-dom';

const Leaderbet = () => {
	return (
		<div>
			{heading.header()}
			<div class="container">
				<div class="row">
					<div class="col-9">
						{cardbox.nav()}
						{cardbox.cardList()}
						{table.listHeading()}
						{table.tableList()}


					</div>
					<div class="col-3">
						{sideBar.sideBarSection1()}
						{sideBar.sideBarSection2()}
					</div>
				</div>
			</div>
		</div>
	)
};
const Gamepage = () => {
	return (
		<div>

		</div>
	)
};

const Main = () => (
      <Switch>
        <Route exact path='/' component={Leaderbet}></Route>
        <Route exact path='/Gamepage' component={Gamepage}></Route>
      </Switch>
    );

ReactDOM.render(
	<BrowserRouter>
		<Main />
	</BrowserRouter>
	,
	document.querySelector('#root')
);

